		\u7B2C\u4E00\u4E2A\u9636\u6BB5: \u5728Spring\u5BB9\u5668\u52A0\u8F7D\u7684\u65F6\u5019\uFF0C\u5B9E\u4F8B\u5316Bean\uFF0C\u53EA\u8981\u5176\u4E2D\u4EFB\u610F\u4E00\u4E2ABean\u5B9E\u4F8B\u5316\u4E4B\u540E\uFF0C\u9A6C\u4E0A\u8FDB\u884C\u201C\u66DD\u5149\u201D\u3010\u4E0D\u7B49\u5C5E\u6027\u8D4B\u503C\u5C31\u66DD\u5149\u3011
